import {BrowserRouter,Route,Routes,Link} from "react-router-dom";  

import Login from "./login";
import Backend from "./backend";
import Personal from "./personal";
import Admin from "./admin";
import Manager from "./manager";

const Home=()=> {
  function select_route(){
    var permession=window.sessionStorage.getItem('permession')
    if(permession==="admin"){
      return(<Admin/>)
    }
    else if(permession==="manager"){
        return(<Manager/>)
    }
    else{
        return(<Personal/>)
    }
  }

  return (
      <BrowserRouter>
      <Routes>

        <Route exact={true} path="/" element={<Login/>}/>
        <Route exact={true} path="/login" element={<Login/>}/>
        <Route exact={true} path="/backend" element={<Backend/>}/>
        <Route exact={true} path="/backend/personal"element={<Personal/>}/>
        <Route exact={true} path="/backend/admin"element={<Admin/>}/>
        <Route exact={true} path="/backend/manager"element={<Manager/>}/>


      </Routes>

      </BrowserRouter>
  )
}

export default Home;
